import React, { useState } from 'react';
import './App.css';
import Navbar from './components/Navbar/Navbar'; // Adjust path if necessary

function App() {
  const [todos, setTodos] = useState([]);
  const [task, setTask] = useState('');
  const [error, setError] = useState(null);


  useEffect(() => {
    fetch('http://localhost:1433/api/tasks')
      .then(response => response.json())
      .then(data => {
        setTodos(data); // Assuming the API returns an array of tasks
      })
      .catch(error => {
        console.error('Error fetching tasks:', error);
        setError('Failed to fetch tasks.'); // Set error state
      });
  }, []);

  const addTask = () => {
    if (task.trim() === '') {
      setError('Task description cannot be empty.');
      return;
    }

    fetch('http://localhost:1433/api/tasks', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({ description: task }),
    })
      .then(response => response.json())
      .then(data => {
        if (data.taskId) {
          setTodos([...todos, { Id: data.taskId, Description: task }]);
          setTask('');
          setError(null);
        }
      })
      .catch(error => {
        console.error('Error adding task:', error);
        setError('Failed to add task.');
      });
  };

  return (
    <>
      <Navbar />
      <div className="App">
        <header className="App-header">
          <h1>ToDo List</h1>
          <input
            type="text"
            value={task}
            onChange={(e) => setTask(e.target.value)}
            placeholder="Enter task description"
          />
          <button onClick={addTask}>Add Task</button>
          {error && <p className="error">{error}</p>}
          <ul>
            {todos.length > 0 ? (
              todos.map(todo => (
                <li key={todo.Id}>{todo.Description}</li>
              ))
            ) : (
              <p>No tasks available</p>
            )}
          </ul>
        </header>
      </div>
    </>
  );
}

export default App;
